import React from 'react';
import { Map, TileLayer } from 'react-leaflet';
import L from 'leaflet';

const styles = {
  wrapper: { 
    height: 400, 
    width: '80%', 
    margin: '0 auto', 
    display: 'flex' 
  },
  map: {
    flex: 1
  } 
};

const Moves = props => {
  return (
    <div style={styles.wrapper}>
      <Map 
      style={styles.map}
      center={props.center}
    zoom={props.zoom}
    >
    <Popup
    position={[-25.3915576,-57.3583898]}
    >
        <div>
            <h2>Lugar</h2>
            <p>Descripcion</p>
        </div>
    </Popup>


        <TileLayer url={props.url} />
      </Map>
    </div>
  );
}

Moves.defaultProps = {
  center: [-23.3601939, -62.9459786],
  zoom: 10,
  url: 'https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png'
};

export default Moves;
